<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8" />
    <link href="diaYearRange.css" rel="stylesheet" />
    <script type="text/javascript" src="diaYearRangeService.js"></script>
    <script type="text/javascript" src="diaYearRangeController.js"></script>
    <script type="text/javascript" src="diaYearRange.js"></script>
</head>
<body class="win-type-body">
    <div class="diaYearRange fragment">
        <div id="diaYearRangeController" class="data-container">
            <section aria-label="Main content" role="main" class="animationElement">
                <div class="yearrange-chart-top-container">
                    <div class="yearrange-chart-top-text-container">
                        <span class="yearrange-chart-top-text" data-win-res="{textContent: 'diaYearRange.title'}"></span>
                    </div>
                    <div class="yearrange-chart-top-combo-container">

                    </div>
                </div>
                <div class="chart-container">
                    <div class="chart-container-block1">
                        <canvas id="yearRangeChart1"></canvas>
                    </div>
                    <div class="chart-container-block2">
                        <canvas id="yearRangeChart2"></canvas>
                    </div>
                    <div class="chart-container-block3">
                        <canvas id="yearRangeChart3"></canvas>
                    </div>
                    <div class="chart-container-block4">
                        <canvas id="yearRangeChart4"></canvas>
                    </div>
                </div>
            </section>
        </div>
    </div>
</body>
</html>
